script: |
  super -f text -I q11505.spq | sort > q11505.out

inputs:
  - name: q11505.spq
    data: |
      SELECT - col0 AS col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT col1 / + - ( col0 ) * col0 * + + col2 - + col2 = - + ( - col1 );
  - name: tab0

outputs:
  - name: q11505.out
    data: |
      -15
      -87
      -97
